import React from "react";
import { Routes, Route, Link } from "react-router-dom";
import Welcome from "./pages/Welcome";
import Students from "./pages/Students";

export default function App() {
  return (
    <div
      style={{
        minHeight: "100vh",
        display: "flex",
        flexDirection: "column",
        backgroundColor: "#f5f5f5", // fondo general de la página
        fontFamily: "Arial, sans-serif"
      }}
    >
      {/* Navegación */}
      <nav
        style={{
          display: "flex",
          gap: "20px",
          padding: "15px 20px",
          backgroundColor: "#4caf50", // nav verde
          color: "#fff",
          fontWeight: "bold"
        }}
      >
        <Link style={{ color: "#fff", textDecoration: "none" }} to="/">
          Bienvenida
        </Link>
        <Link style={{ color: "#fff", textDecoration: "none" }} to="/students">
          Sistema Estudiantes
        </Link>
      </nav>

      {/* Contenido */}
      <div style={{ flex: 1, padding: "20px" }}>
        <Routes>
          <Route path="/" element={<Welcome />} />
          <Route path="/students" element={<Students />} />
        </Routes>
      </div>

      {/* Footer */}
      <div
        style={{
          display: "flex",
          justifyContent: "space-between",
          padding: "10px 20px",
          fontSize: "14px",
          color: "#ffeb3b", // letra luminosa amarilla
          backgroundColor: "#333", // fondo oscuro
          fontWeight: "bold",
          textShadow: "1px 1px 2px #000", // sombra para resaltar
          borderTop: "2px solid #444"
        }}
      >
        <span>© 2025</span>
        <span>Elaborado por: Jessenia Zambrano</span>
      </div>
    </div>
  );
}
